import {Component, Input, OnInit, SimpleChanges} from '@angular/core';
import {DateUtilsService} from "app/core/util/date-utils.service";
import {
  OthersLegacySubData
} from "app/claim/se-claim/se-claim-verification/working-data-section/others-legacy/others-legacy.model";
import {SEClaimService} from "app/claim/se-claim/service/se-claim.service";
import {Ns2Response} from "app/shared/model/ns2-response.model";
import {HttpParams} from "@angular/common/http";

@Component({
  selector: 'n2-others-legacy',
  templateUrl: './others-legacy.component.html',
  styleUrls: ['./others-legacy.component.scss']
})


export class OthersLegacyComponent implements OnInit {

  @Input() seHardCopyDetails:any = {};
  @Input() selectedWDOption:any = {};

  currSelectedOption: any;

  cols: string[] = [];
  rowHeaders: string[] = [];
  othersLegacyArr: OthersLegacySubData[] = [];

  constructor(
    public dateUtilsService: DateUtilsService,
    private seClaimService: SEClaimService) {
    this.cols = [
      "Annual Account",
      "Ave Monthly",
      "6-Mth Account",
      "Ave Monthly"
    ]
    this.rowHeaders = [
      "Divisor",
      "Turnover/Gross Income",
      "Gross Profit",
      "Less Expense",
      "Net Profit/Income",
      "Co’s Net Profit/Income Ratio",
      "NSman’s Share of Profit",
      "NSman’s Partner Salary",
      "Total Income"
    ]

  }

  ngOnInit(): void {
    console.log("test")
  }

  ngOnChanges(changes: SimpleChanges): void{
    // if(changes.seHardCopyDetails?.currentValue){
    //   this.currHardCopyDetails=changes.seHardCopyDetails.currentValue;
    //   this.constructSourceYearOptions();
    //   this.constructPeriodEndDateOptions();
    // }
    if(changes.selectedWDOption?.currentValue){
      this.currSelectedOption = changes.selectedWDOption?.currentValue;
      this.retrieveOthersLegacyWD();
    }
  }

  retrieveOthersLegacyWD(): void {
    let params = new HttpParams();
    params = params.append("workingDataId", this.currSelectedOption?.workingDataId);
    this.seClaimService.retrieveOthersLegacyWD(params)
      .subscribe((res: Ns2Response<OthersLegacySubData[]>) => {
        if (res.data) {
          res.data.forEach((othersLegSubData: OthersLegacySubData) => {
            this.othersLegacyArr.push(othersLegSubData);
            const average: OthersLegacySubData = {
              "turnover": othersLegSubData.turnover / othersLegSubData.divisor,
              "grossProfit": othersLegSubData.grossProfit / othersLegSubData.divisor,
              "expenses": othersLegSubData.expenses / othersLegSubData.divisor,
              "profitShare": othersLegSubData.profitShare / othersLegSubData.divisor,
              "partnerSalary": othersLegSubData.partnerSalary / othersLegSubData.divisor,
              "divisor": null,
            }
            this.othersLegacyArr.push(average);
          });
        }
      });
  }

  calculateNetProfitIncome(othersLegSubData: OthersLegacySubData): number{
    return othersLegSubData.grossProfit - othersLegSubData.expenses;
  }

  calculateNetProfitIncomeRatio(othersLegSubData: OthersLegacySubData): number{
    return this.calculateNetProfitIncome(othersLegSubData)/othersLegSubData.turnover * 100;
  }

  calculateTotalIncome(othersLegSubData: OthersLegacySubData): number{
    return othersLegSubData.profitShare + othersLegSubData.partnerSalary;
  }
}
<div *ngIf = "othersLegacyArr !== undefined && othersLegacyArr !== null">
  <p-table
    [value] = "rowHeaders"
    styleClass="p-datatable-gridlines p-datatable-striped"
    responsiveLayout="scroll"
    [style]="{'width':'60vw'}"
  >
    <ng-template pTemplate="header">
      <tr>
        <th scope="col"></th>
        <th scope="colgroup" colspan = "4">
          <p-button icon="pi pi-file-o" [style]="{'margin-left': '.5em', 'margin-right': '.5em'}"></p-button>
        </th>
      </tr>
      <tr>
        <th scope="col"></th>
        <th scope="col" *ngFor="let col of cols; let i = index"
            [style] = "{'text-align':'center'}"
            [ngStyle]= "{'border-right': i === 1 ? '2px solid black' :''}">
          {{col}}</th>
      </tr>
    </ng-template>
    <ng-template pTemplate="body" let-rowHeaders let-rowIndex="rowIndex" >
      <tr *ngIf ="rowIndex === 0">
        <td>{{rowHeaders}}</td>
        <td *ngFor = "let col of cols; let i = index"
            [style] = "{'text-align':'right'}"
            [ngStyle]= "{'border-right': i === 1 ? '2px solid black' :''}">
          <div>{{othersLegacyArr[i].divisor | number : '1.0-0'}}</div>

        </td>
      </tr>
      <tr *ngIf ="rowIndex === 1">
        <td>{{rowHeaders}}</td>
        <td *ngFor = "let col of cols; let i = index"
            [style] = "{'text-align':'right'}"
            [ngStyle]= "{'border-right': i === 1 ? '2px solid black' :''}">
          {{othersLegacyArr[i].turnover | number : '1.2-2'}}
        </td>
      </tr>
      <tr *ngIf ="rowIndex === 2">
        <td>{{rowHeaders}}</td>
        <td *ngFor = "let col of cols; let i = index"
            [style] = "{'text-align':'right'}"
            [ngStyle]= "{'border-right': i === 1 ? '2px solid black' :''}">
          {{othersLegacyArr[i].grossProfit | number : '1.2-2'}}
        </td>
      </tr>
      <tr *ngIf ="rowIndex === 3">
        <td>{{rowHeaders}}</td>
        <td *ngFor = "let col of cols; let i = index"
            [style] = "{'text-align':'right'}"
            [ngStyle]= "{'border-right': i === 1 ? '2px solid black' :''}">
          {{othersLegacyArr[i].expenses | number : '1.2-2'}}
        </td>
      </tr>
      <tr *ngIf ="rowIndex === 4">
        <td>{{rowHeaders}}</td>
        <td *ngFor = "let col of cols; let i = index"
            [style]="{'border-bottom': '2px solid black', 'border-top': '2px solid black', 'text-align':'right'}"
            [ngStyle]= "{'border-right': i === 1 ? '2px solid black' :''}">
          {{calculateNetProfitIncome(othersLegacyArr[i]) | number : '1.2-2'}}
        </td>
      </tr>
      <tr *ngIf ="rowIndex === 5">
        <td>{{rowHeaders}}</td>
        <td *ngFor = "let col of cols; let i = index"
            [style] = "{'text-align':'right'}"
            [ngStyle]= "{'border-right': i === 1 ? '2px solid black' :''}">
          <div *ngIf = "i%2 === 0">
            {{calculateNetProfitIncomeRatio(othersLegacyArr[i])| number : '1.0-0'}}%
          </div>
        </td>
      </tr>
      <tr *ngIf ="rowIndex === 6">
        <td>{{rowHeaders}}</td>
        <td *ngFor = "let col of cols; let i = index"
            [style] = "{'text-align':'right'}"
            [ngStyle]= "{'border-right': i === 1 ? '2px solid black' :''}">
          {{othersLegacyArr[i].profitShare | number : '1.2-2'}}
        </td>
      </tr>
      <tr *ngIf ="rowIndex === 7">
        <td>{{rowHeaders}}</td>
        <td *ngFor = "let col of cols; let i = index"
            [style] = "{'text-align':'right'}"
            [ngStyle]= "{'border-right': i === 1 ? '2px solid black' :''}">
          {{othersLegacyArr[i].partnerSalary | number : '1.2-2'}}
        </td>
      </tr>
      <tr *ngIf ="rowIndex === 8">
        <td>{{rowHeaders}}</td>
        <td *ngFor = "let col of cols; let i = index"
            [style]="{'border-bottom': '2px solid black', 'border-top': '2px solid black', 'text-align':'right'}"
            [ngStyle]= "{'border-right': i === 1 ? '2px solid black' :''}">
          {{calculateTotalIncome(othersLegacyArr[i]) | number : '1.2-2'}}
        </td>
      </tr>
    </ng-template>
  </p-table>
</div>
<div *ngIf = "othersLegacyArr === undefined || othersLegacyArr === null">
  No Others (Legacy) Working Data Found
</div>
